import React from "react";
import classes from "./SearchUser.module.css";

function SwitchUser(){
return(
  <div>
  <input type="text" className={classes.searchUser} placeholder="Enter your UserName" />
  <input type="button" className={classes.goButton} value="GO" />
  <input type="button" className={classes.clearUser} value="Clear" />
  <input type="text" className={classes.searchRepo} placeholder="Enter Some Keywords To Filter Eg:algo." />
  <input type="button" className={classes.clearRepo} value="GO" />
  </div>
) 
}
export default SwitchUser;
